}

const AppointmentBanner = () => {
    
    return (
        <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <img style={{
            width:400
          }} src={doctor} alt="" />
